n;• Разрабатывал архитектуру и логику проекта;• Занимался стилизацией проекта при помощи CSS, Bootstrap;• Организовал загрузку изображений при помощи multer;• Разработал архитектуру БД, настраивал связи.Ищу работу на позицию frontend-разработчика, умею решать сложные задачи, оптимизировать процессы, искать пути и технологии для улучшения продукта, знаком с полноценным циклом разработки, могу настроить клиент-серверное взаимодействие.

